INSERT INTO `project_details` (`project_id`, `pdf_file`, `Title`, `Authors`, `Publication_Year`, `course_ID`, `course_name`, `major_ID`, `major_name`, `Keywords`, `Abstract`, `generated_imrad`, `Citation_Authors`, `Citation_Title`, `is_deleted`) VALUES
(2, , 'Automated System Monitoring and  Notification With Swatch', ' Stephen E. Hansen & E. Todd Atkins', '2021', 1, 'Bachelor of Science in Information Technology', 1, 'Software Engineering', 'hehe', ' This paper describes an approach to monitoring events on a large number of servers and\r\n workstations. While modern UNIX systems are capable of logging a variety of information\r\n concerning the health and status of their hardware and operating system software, they are\r\n generally not configured to do so. Even when this information is logged, it is often hidden in\r\n places that are either not monitored regularly or are susceptible to deletion or modification by\r\n a successful intruder. Also, a system administrator must often monitor several, perhaps\r\n dozens, of systems. To address these problems, our approach begins with the modification of\r\n certain system programs to enhance their logging capabilities. In addition, our approach calls\r\n for the logging facilities on each of these systems to be configured in such a way as to send\r\n a copy of the critical system and security related information to a dependable, secure, central\r\n logging host system. As one might expect, this central log can see a megabyte or more of\r\n data in a single day. To keep a system administrator from being overwhelmed by a large\r\n quantity of data we have developed an easily configurable log file filter/monitor, called\r\n swatch. Swatch monitors log files and acts to filter out unwanted data and take one or more\r\n user specified actions (ring bell, send mail, execute a script, etc.) based upon patterns in the\r\n log.', 'This paper explores the challenges of monitoring events on a large number of servers and workstations within a UNIX environment.  Traditional UNIX systems, while capable of logging various information about their health and status, often lack proper configuration and leave this crucial data vulnerable to deletion or modification by intruders. Furthermore, system administrators typically oversee numerous systems, making manual monitoring a time-consuming and error-prone task. To tackle these issues, the authors propose a multi-faceted approach. First, they enhance the logging capabilities of certain system programs, particularly focusing on security-related activities. Second, they advocate for centralizing log information by forwarding critical system and security logs from each server to a dedicated, secure central logging host, known as the LOGMASTER. The central log, however, can generate a vast amount of data, posing a challenge for administrators to sift through. To address this, the authors introduce Swatch, a configurable log file filter/monitor, designed to filter out unwanted data and execute user-specified actions based on patterns in the log.\n\nSwatch\'s design prioritizes ease of use and configurability, aiming to be user-friendly for system administrators. It provides a simple set of actions, allowing users to define their own actions and utilize portions of the input as arguments for those actions. Furthermore, Swatch is recongurable on demand or at specified intervals without the need for manual restarts. The core of Swatch\'s functionality relies on expression matching, utilizing the Perl language for its flexibility and familiarity among system administrators. Swatch consists of three main components: a configuration file, a library of actions, and a controlling program. The configuration file defines patterns and corresponding actions, allowing users to tailor Swatch to their specific monitoring needs. Swatch supports a range of actions, including echoing messages, sending bell signals, ignoring specific lines, sending mail, piping data to other commands, and executing commands. The controlling program manages the execution of the watcher process, which is responsible for real-time monitoring and action execution. \n\nThe authors demonstrate Swatch\'s capabilities through two real-world examples. The first example illustrates the use of Swatch for continuous monitoring of high-priority events, such as system crashes, reboots, and \"file system full\" messages. The second example showcases a personalized Swatch configuration file used for individual monitoring tasks, tailored to the administrator\'s preferences and responsibilities. Swatch has proven invaluable in detecting intruders, preventing system failures, and optimizing monitoring processes.  While the authors acknowledge the need to further improve logging capabilities in additional system utilities, they believe Swatch is a powerful tool that can significantly enhance system monitoring and security within a UNIX environment. \n', 'Hansen,S., & Atkins, T.E', 'Automated System Monitoring and Notification With Swatch', 0);
